const firebaseConfig = {
  apiKey: "AIzaSyCLsNFa76tJ0zyXMyAw7OegwpKWJZMONoM" ,
  authDomain: "laboratorio-clinico-73ef6.firebaseapp.com" ,
  projectId: "laboratorio-clinico-73ef6" ,
  storageBucket: "laboratorio-clinico-73ef6.appspot.com" ,
  messagingSenderId:"1070873772890" , 
  appId: "1:1070873772890:web:464c07b152a0b4da8a6963" ,
  measurementId: "G-G2GPB1WEH8" 
}
// Initialize Firebase
const app = initializeApp(firebaseConfig);
export const analytics = getAnalytics(app);
export const db = getFirestore();
export default app;
